import Header from './Header';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const MyLayout = ({ children }) => {
  return (
    <div style={layoutStyle}>
      <Header />
      {children}
    </div>
  );
};

export default MyLayout;
